// ==UserScript==
// @name         Carimbador GED 5.2 - Henrique -30% + print: assinatura majoritariamente acima
// @namespace    http://tampermonkey.net/
// @version      5.2
// @description  Assinaturas sobrepostas (maioria acima) e protegidas contra corte na impressão; Henrique -30% adicional; otimizado.
// @match        http://sigeduca.seduc.mt.gov.br/ged/hwgedteladocumento.aspx?*
// @require      https://code.jquery.com/jquery-3.6.0.min.js
// @grant        none
// ==/UserScript==

(function () {
    'use strict';

    // -------------- CONFIG --------------
    const FLOAT_MENU_ID = 'carimbo-floating-menu-v52';
    const BASE_SCALE = 2.5 * 2;                // mantém o aumento 2x que você pediu antes
    // Henrique: redução anterior (0.64) * 0.7 => 0.448 (30% menor que a versão anterior do Henrique)
    const HENRIQUE_MULTIPLIER = 0.64 * 0.7;    // = 0.448
    const VISUAL_TRANSLATE_Y = '-50%';         // aparência na tela (centrado)
    const PRINT_OVERLAP_RATIO = 0.12;          // proporção da imagem que fica sobreposta ao bloco NO PRINT (12%)
    const PRINT_BOTTOM_MARGIN_PX = 180;        // margem virtual para detecção de corte (se necessário)
    const MIN_SCALE_ON_FIT = 0.55;             // escala mínima permitida no ajuste de print
    const MAX_PRINT_ADJUST_MS = 1400;          // tempo máximo para ajustes no beforeprint (segurança)
    // ------------------------------------

    // --------- COLE AQUI suas imagens base64 (entre backticks `...`) ----------
    const assinaturaJoao = `data:image/png;base64,`;
    const assinaturaHenrique = `data:image/png;base64,`;

    // ------------------------------------------------------------------------

    function validarBase64(s) { return typeof s === 'string' && s.startsWith('data:image/'); }

    // ---------------- Inserção wrapper + overlay (visual em tela) ----------------
    function inserirAssinaturaOverlay(base64, spanDestino, roleKey) {
        if (!validarBase64(base64)) return;
        try {
            // Remove overlay anterior se existir
            if (spanDestino.__assinatura_overlay) {
                spanDestino.__assinatura_overlay.remove();
                spanDestino.__assinatura_overlay = null;
            }

            // garantir que o span preserve quebras e seja inline (não desloque linhas)
            spanDestino.style.whiteSpace = 'pre';
            spanDestino.style.display = 'inline';
            spanDestino.style.verticalAlign = 'baseline';

            // criar/reutilizar wrapper inline (mantém fluxo)
            let wrapper = spanDestino.__assinatura_wrapper;
            if (!wrapper) {
                wrapper = document.createElement('div');
                wrapper.style.display = 'inline';
                wrapper.style.position = 'relative';
                wrapper.style.padding = '0';
                wrapper.style.margin = '0';
                wrapper.style.verticalAlign = 'baseline';
                // marcar para evitar quebra entre páginas
                wrapper.style.pageBreakInside = 'avoid';
                wrapper.style.breakInside = 'avoid';
                wrapper.style.webkitColumnBreakInside = 'avoid';
                spanDestino.parentNode.insertBefore(wrapper, spanDestino);
                wrapper.appendChild(spanDestino);
                spanDestino.__assinatura_wrapper = wrapper;
            } else {
                // reafirmar
                wrapper.style.position = 'relative';
                wrapper.style.display = 'inline';
            }

            // criar imagem (overlay para visual)
            const img = document.createElement('img');
            img.src = base64;
            img.alt = 'assinatura-' + (roleKey || '');
            img.style.position = 'absolute';
            img.style.left = '50%';
            img.style.top = '50%';
            img.style.transform = `translate(-50%, ${VISUAL_TRANSLATE_Y})`;
            img.style.objectFit = 'contain';
            img.style.pointerEvents = 'none';
            img.style.zIndex = '9999';
            img.style.background = 'transparent';
            img.style.border = '0';
            img.style.display = 'block';

            img.onerror = function () { console.warn('Assinatura não carregou (onerror):', roleKey); img.style.display = 'none'; };

            wrapper.appendChild(img);

            // calcular dimensão base (uma vez) - usa BASE_SCALE e HENRIQUE_MULTIPLIER
            const larguraSpan = spanDestino.offsetWidth || 240;
            const fs = window.getComputedStyle(spanDestino).fontSize;
            let fontSizePx = 14;
            if (fs && fs.endsWith('px')) fontSizePx = parseFloat(fs);
            const alturaBase = Math.round(fontSizePx * 4);

            let roleScale = BASE_SCALE;
            if (roleKey === 'henrique') roleScale = BASE_SCALE * HENRIQUE_MULTIPLIER;

            const imgW = Math.round(larguraSpan * roleScale);
            const imgH = Math.round(alturaBase * roleScale);

            img.style.width = imgW + 'px';
            img.style.height = imgH + 'px';

            // guardar valores numéricos para uso no beforeprint sem muitos reflows
            img.__orig_width_px = imgW;
            img.__orig_height_px = imgH;
            img.__orig_transform = img.style.transform;
            img.__current_scale = 1;
            spanDestino.__assinatura_overlay = img;
            spanDestino.__assinatura_roleKey = roleKey || '';
        } catch (e) {
            console.error('Erro inserirAssinaturaOverlay:', e);
        }
    }

    // ---------------- beforeprint: garante assinatura majoritariamente acima e sem corte ----------------
    // Estratégia (por assinatura, uma só passagem):
    // - Queremos que a maior parte da imagem fique acima do bloco, apenas PRINT_OVERLAP_RATIO dela sobreponha o bloco.
    // - desiredTop = spanTopLocal - imgHeight + overlapPx
    // - se desiredTop < 0 => reduzir UMA vez proporcionalmente até MIN_SCALE_ON_FIT
    // - se ainda não couber => mover wrapper para cima (último recurso)
    // - também evitar quebra entre páginas movendo wrapper se a bbox final extrapolar margem inferior
    function beforePrintMajorAboveV52() {
        const start = performance.now();

        try {
            // ocultar menu imediatamente
            const menu = document.getElementById(FLOAT_MENU_ID);
            if (menu) menu.style.display = 'none';

            const spans = document.getElementsByTagName('span');
            for (let i = 0; i < spans.length; i++) {
                // safety timeout
                if (performance.now() - start > MAX_PRINT_ADJUST_MS) {
                    console.warn('beforePrintMajorAboveV52: tempo excedido, abortando ajustes restantes.');
                    break;
                }

                const span = spans[i];
                const img = span.__assinatura_overlay;
                const wrapper = span.__assinatura_wrapper;
                if (!img || !wrapper) continue;

                try {
                    // reforça "avoid" no wrapper
                    wrapper.style.pageBreakInside = 'avoid';
                    wrapper.style.breakInside = 'avoid';
                    wrapper.style.webkitColumnBreakInside = 'avoid';

                    // garante imagem em absolute e centragem horizontal
                    img.style.position = 'absolute';
                    img.style.left = '50%';
                    img.style.pointerEvents = 'none';
                    img.style.zIndex = '9999';
                    img.style.display = 'block';

                    // medições rápidas (offsets locais)
                    const spanTopLocal = span.offsetTop;     // px dentro do wrapper
                    const spanHeight = span.offsetHeight;

                    // tamanhos da imagem preferindo valores já calculados
                    let imgHeight = img.__orig_height_px || parseFloat(img.style.height) || img.getBoundingClientRect().height;
                    let imgWidth = img.__orig_width_px || parseFloat(img.style.width) || img.getBoundingClientRect().width;

                    // overlap desejado em px (pequena sobreposição em print)
                    let overlapPx = Math.min(Math.round(imgHeight * PRINT_OVERLAP_RATIO), spanHeight);

                    // desiredImgTop = spanTopLocal - imgHeight + overlapPx  (coloca a maioria da imagem acima)
                    let desiredImgTop = Math.round(spanTopLocal - imgHeight + overlapPx);

                    // se desiredImgTop < 0 -> imagem muito alta; tentar diminuí-la UMA vez (scale único)
                    if (desiredImgTop < 0) {
                        const maxAllowedHeight = Math.max(0, spanTopLocal + overlapPx);
                        let scaleFactor = 1;
                        if (imgHeight > 0) scaleFactor = Math.max(MIN_SCALE_ON_FIT, Math.min(1, maxAllowedHeight / imgHeight));
                        if (scaleFactor < 0.999) {
                            const newH = Math.round(imgHeight * scaleFactor);
                            const newW = Math.round(imgWidth * scaleFactor);
                            img.style.height = newH + 'px';
                            img.style.width = newW + 'px';
                            img.__print_scaled_to = scaleFactor;
                            imgHeight = newH;
                            imgWidth = newW;
                            overlapPx = Math.min(Math.round(imgHeight * PRINT_OVERLAP_RATIO), spanHeight);
                            desiredImgTop = Math.round(spanTopLocal - imgHeight + overlapPx);
                        }
                    }

                    // Se ainda negativo -> mover wrapper para cima (último recurso)
                    if (desiredImgTop < 0) {
                        const needPx = Math.ceil(Math.abs(desiredImgTop) + 6); // buffer
                        if (typeof wrapper.__marginTopBackup === 'undefined') wrapper.__marginTopBackup = wrapper.style.marginTop || '';
                        wrapper.style.marginTop = (parseFloat(wrapper.style.marginTop || 0) - needPx) + 'px';
                        wrapper.__moved_for_print_px = needPx;
                        desiredImgTop = 0; // assumimos que agora cabe
                    }

                    // aplica top e remove translateY (mantém só translateX)
                    img.style.top = desiredImgTop + 'px';
                    img.style.transform = 'translateX(-50%)';

                    // verificação final: se o wrapper extrapola a margem inferior do viewport (pré-visualização)
                    const wrapperRect = wrapper.getBoundingClientRect();
                    const pageHeight = window.innerHeight || (document.documentElement && document.documentElement.clientHeight) || 1122;
                    const bottomLimit = pageHeight - PRINT_BOTTOM_MARGIN_PX;
                    if (wrapperRect.bottom > bottomLimit) {
                        const excess = Math.ceil(wrapperRect.bottom - bottomLimit + 4);
                        if (typeof wrapper.__marginTopBackup === 'undefined') wrapper.__marginTopBackup = wrapper.style.marginTop || '';
                        wrapper.style.marginTop = (parseFloat(wrapper.style.marginTop || 0) - excess) + 'px';
                        wrapper.__moved_for_print_px = (wrapper.__moved_for_print_px || 0) + excess;
                    }

                } catch (innerErr) {
                    console.warn('Erro ajustando assinatura (index ' + i + '):', innerErr);
                }
            }
        } catch (e) {
            console.error('Erro in beforePrintMajorAboveV52:', e);
        }
    }

    // ---------------- afterprint: restaurar tudo ----------------
    function afterPrintRestoreV52() {
        try {
            const menu = document.getElementById(FLOAT_MENU_ID);
            if (menu) menu.style.display = '';

            const spans = document.getElementsByTagName('span');
            for (let i = 0; i < spans.length; i++) {
                const span = spans[i];
                const img = span.__assinatura_overlay;
                const wrapper = span.__assinatura_wrapper;
                if (!img) continue;

                // restaura transform visual original
                img.style.transform = img.__orig_transform || `translate(-50%, ${VISUAL_TRANSLATE_Y})`;

                // restaura dimensões originais se reduzimos para imprimir
                if (img.__print_scaled_to) {
                    if (img.__orig_width_px) img.style.width = img.__orig_width_px + 'px';
                    if (img.__orig_height_px) img.style.height = img.__orig_height_px + 'px';
                    delete img.__print_scaled_to;
                }

                // restaura wrapper margin-top se movemos
                if (wrapper && wrapper.__moved_for_print_px) {
                    wrapper.style.marginTop = wrapper.__marginTopBackup || '';
                    delete wrapper.__moved_for_print_px;
                    delete wrapper.__marginTopBackup;
                }
            }
        } catch (e) {
            console.error('Erro in afterPrintRestoreV52:', e);
        }
    }

    // ligar listeners de impressão
    if (window.matchMedia) {
        window.addEventListener('beforeprint', beforePrintMajorAboveV52);
        window.addEventListener('afterprint', afterPrintRestoreV52);
    } else {
        window.onbeforeprint = beforePrintMajorAboveV52;
        window.onafterprint = afterPrintRestoreV52;
    }

    // ----------------- Função carimbar (texto + inserir assinaturas) -----------------
    function carimbar(TAE) {
        const spans = document.getElementsByTagName('span');
        const secretario = "JOÃO VITOR CARDOSO FERREIRA\nSecretário Escolar\nMatrícula 287354";
        const diretor = "HENRIQUE BARROS DE SOUZA\nDiretor Escolar\nMatrícula 256211";
        const tecnico = `${TAE}\nTéc. Administrativo Escolar\nE.E. Padre Ernesto Camilo Barreto`;

        for (let i = 0; i < spans.length; i++) {
            const t = spans[i].textContent.trim();

            if (t === "Secretário(a)" || t === "Secretário(a) Escolar") {
                spans[i].style.whiteSpace = 'pre';
                spans[i].style.display = 'inline';
                spans[i].textContent = secretario;
                inserirAssinaturaOverlay(assinaturaJoao, spans[i], 'joao');
            }

            if (t === "Diretor(a)") {
                spans[i].style.whiteSpace = 'pre';
                spans[i].style.display = 'inline';
                spans[i].textContent = diretor;
                inserirAssinaturaOverlay(assinaturaHenrique, spans[i], 'henrique');
            }

            if (t === "Funcionário(a) Responsável") {
                spans[i].style.whiteSpace = 'pre';
                spans[i].style.display = 'inline';
                spans[i].textContent = tecnico;
            }
        }
    }

    // ----------------- Menu flutuante -----------------
    function criarMenu() {
        const tecs = [
            "JOÃO VITOR CARDOSO FERREIRA",
            "BARBARA CRISTINA DE ALMEIDA",
            "ANDRESSA MOREIRA DE ALMEIDA"
        ];

        const menu = document.createElement('div');
        menu.id = FLOAT_MENU_ID;
        menu.style.position = 'fixed';
        menu.style.bottom = '50%';
        menu.style.right = '0';
        menu.style.transform = 'translateY(50%)';
        menu.style.background = '#fff';
        menu.style.padding = '10px';
        menu.style.border = '1px solid #ccc';
        menu.style.borderRadius = '5px';
        menu.style.zIndex = '100000';

        const btn = document.createElement('button');
        btn.textContent = 'Carimbo Digital';
        btn.onclick = () => { sub.style.display = sub.style.display === 'none' ? 'block' : 'none'; };
        menu.appendChild(btn);

        const sub = document.createElement('div');
        sub.style.display = 'none';
        sub.style.marginTop = '10px';

        tecs.forEach(nome => {
            const b = document.createElement('button');
            b.textContent = nome;
            b.style.display = 'block';
            b.style.marginTop = '5px';
            b.onclick = () => carimbar(nome);
            sub.appendChild(b);
        });

        menu.appendChild(sub);
        document.body.appendChild(menu);

        // CSS para impressão: esconder menu e reforçar avoid-break
        const style = document.createElement('style');
        style.innerHTML = `
            @media print {
                #${FLOAT_MENU_ID} { display: none !important; }
                div[style*="page-break-inside: avoid"] { page-break-inside: avoid !important; break-inside: avoid !important; -webkit-column-break-inside: avoid !important; }
            }
        `;
        document.head.appendChild(style);
    }

    // inicializa
    criarMenu();

})();
